import React, { ReactElement } from "react";
import styled from "styled-components/native";
import TagSelect from "../components/TagSelect";
import FM from "./FM/index";

interface Props {}

export default function Root({}: Props): ReactElement {
  return (
    <Styled.container>
      {/* <FM /> */}
      <TagSelect
        heading={"Select the Tags which best describes your bond with them"}
        max={3}
        options={[
          "Friends",
          "Family",
          "School",
          "College",
          "Network",
          "Services",
        ]}
      />
    </Styled.container>
  );
}

const Styled = {
  container: styled.View`
    flex: 1;
  `,
  heading: styled.Text``,
};
